import React from 'react';
//Styles imports
import {Navbar, NavbarBrand} from 'reactstrap'

const NaviBar = ({}) => (
  <div>
  <Navbar color="dark" dark expand="md">
    <NavbarBrand>
      <img src="http://chittagongit.com/images/icon-png-logos/icon-png-logos-7.jpg" alt="logo" className="img-fluid"/>
    </NavbarBrand>
  </Navbar>
</div>

);

export default NaviBar;
